import React from 'react';

function TopNavRightSelect(props) {
    const select = {
        option : "سجل هنا",
        option : "الاشتراك"
    }
    return (
        <li><select id="basic" className="selectpicker show-tick form-control" placeholder="تسجيل الدخول" title="register">
            <option>{props.select.option}</option>
            </select>
            <i className="fas fa-users"></i>
            </li>
    );
};

export default TopNavRightSelect;
